import React from "react";
import {Container} from 'react-bootstrap'

let cardFood = ({items}) => {

    return (
        <div>
            <div className="foodCart">
                <Container>
                    <div className="content">
                    {
                        items.length >= 1 ? (
                            items.map((data) => {
                                {
                                    return (
                                        <div  className="cart">
            
                                        <img src={data.img} />
                                        <h4> {data.title} </h4>
                                        <span> {data.price} </span>
                                        <span className="butt">
                                           Order now
                                        </span>
                                  </div>
                                    )
                                }
                            })
                        ) : "<h1>"
                    }
                    </div>
                </Container>
            </div>
        </div>
    )
}

export default cardFood
